"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Lichen planus (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H12718985\">",
"      <span class=\"h1\">",
"       What is lichen planus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Lichen planus is a condition that causes red, purple, or white spots to form on the skin. These spots often itch or hurt. Lichen planus can affect the skin anywhere on the body, including the skin in and around the vagina and penis, and the pink, moist skin that lines the mouth.",
"     </p>",
"     <p>",
"      In most cases, doctors do not know what causes lichen planus.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12719000\">",
"      <span class=\"h1\">",
"       What are the symptoms of lichen planus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Lichen planus causes different symptoms, depending on which part of the body is affected.",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        On the",
"        <strong>",
"         skin",
"        </strong>",
"        , it usually causes shiny, flat, red, or purple spots (",
"        <a class=\"graphic graphic_picture graphicRef87024 \" href=\"UTD.htm?12/21/12630\">",
"         picture 1",
"        </a>",
"        ). These spots tend to form on the wrists, arms, or legs, but might also show up on other areas. The spots are often very itchy. As the spots heal, they can turn dark.",
"       </li>",
"       <li>",
"        On the",
"        <strong>",
"         nails",
"        </strong>",
"        , it can cause lines or ridges to form.",
"       </li>",
"       <li>",
"        On the",
"        <strong>",
"        </strong>",
"        &ldquo;",
"        <strong>",
"         mucous membranes",
"        </strong>",
"        ,&rdquo; the pink moist skin that lines the inside of the mouth, the vagina, and other organs, it can cause redness, painful sores, or patterns that look like white lace. When lichen planus affects the mouth, it can make it hard to eat.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12719041\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, if you have symptoms like those listed above, see your doctor or nurse.",
"     </p>",
"     <p>",
"      Your doctor or nurse will probably be able to tell if you have lichen planus by learning about your symptoms and doing an exam. It&rsquo;s also possible your doctor or nurse will take a small sample of skin to send to the lab. This is called a skin &ldquo;biopsy.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12719058\">",
"      <span class=\"h1\">",
"       How is lichen planus treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment is different depending on which part of the body is affected and how bad the symptoms are. In general, treatment can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Steroid medicines that come in ointments, creams, or gels &ndash; These steroid medicines reduce inflammation and help the skin heal. Examples include",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?8/16/8452?source=see_link\">",
"         fluocinonide",
"        </a>",
"        or",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?13/34/13860?source=see_link\">",
"         clobetasol",
"        </a>",
"        .",
"       </li>",
"       <li>",
"        Medicines called calcineurin inhibitors, such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?3/7/3189?source=see_link\">",
"         pimecrolimus",
"        </a>",
"        (brand name: Elidel) and",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?37/24/38272?source=see_link\">",
"         tacrolimus",
"        </a>",
"        (brand name: Protopic)",
"       </li>",
"       <li>",
"        Medicines that numb the skin and help with pain, especially for people who have sores on their mouth or sex organs",
"       </li>",
"       <li>",
"        Pills that help to reduce inflammation and help the skin heal",
"       </li>",
"       <li>",
"        A special type of light treatment called phototherapy",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some people need to try more than 1 medicine before they find the medicine that works best for them.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12719073\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Here are some things you should do:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Take good care of your skin. Wash and dry your skin gently when you take a shower or bath. Try not to scratch itchy skin because that can increase the chance of infection. Scratching can also make lichen planus worse.",
"       </li>",
"       <li>",
"        If you have lichen planus in your mouth, make sure you take good care of your teeth and gums. You should brush your teeth twice a day with a soft brush and floss every day. Not taking good care of your mouth could make lichen planus worse and might cause other problems from unhealthy teeth and gums.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12719088\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
