"   <div class=\"block mop drugH1Div\" id=\"F186275\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Serum levels of concurrent anticonvulsants, LFTs, renal function, hypersensitivity reactions (especially rash); seizure, frequency and duration; suicidality (eg, suicidal thoughts, depression, behavioral changes); signs/symptoms of aseptic meningitis",
"    </p>",
"   </div>",
"   <div class=\"block rer drugH1Div\" id=\"F186278\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reference Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     A therapeutic serum concentration range has not been established for lamotrigine. Dosing should be based on therapeutic response. Lamotrigine plasma concentrations of 0.25-29.1 mcg/mL have been reported in the literature.",
"    </p>",
"   </div>",
