"   <div class=\"block pha drugH1Div\" id=\"F186265\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     A triazine derivative which inhibits release of glutamate (an excitatory amino acid) and inhibits voltage-sensitive sodium channels, which stabilizes neuronal membranes. Lamotrigine has weak inhibitory effect on the 5-HT",
"     <sub>",
"      3",
"     </sub>",
"     receptor;",
"     <i>",
"      in vitro",
"     </i>",
"     inhibits dihydrofolate reductase.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F186285\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Immediate release: Rapid and complete",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 0.9-1.3 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: ~55%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic and renal; metabolized primarily by glucuronic acid conjugation to inactive metabolites",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Immediate release: 98%;",
"     <b>",
"      Note:",
"     </b>",
"     AUCs were similar for immediate release and extended release preparations in patients receiving nonenzyme-inducing AEDs. In subjects receiving concomitant enzyme-inducing AEDs, bioavailability of extended release product was ~21% lower than immediate release product; in some of these subjects, a decrease in AUC of up to 70% was observed when switching from immediate release to extended release tablets.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Immediate release: Adults: 25-33 hours, Elderly: 25-43 hours; Extended release: Similar to immediate release",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Concomitant valproic acid therapy: 48-70 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Concomitant phenytoin, phenobarbital, primidone, or carbamazepine therapy: 13-14 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Chronic renal failure: 43 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Hemodialysis: 13 hours during dialysis; 57 hours between dialysis (~20% of a dose is eliminated in a 4-hour dialysis session)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Hepatic impairment:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Mild: 26-66 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Moderate: 28-116 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Severe without ascites: 56-78 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Severe with ascites: 52-148 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, plasma: Immediate release: 1-1.5 hours; Extended release: 4-11 hours (dependent on adjunct therapy)",
"    </p>",
