" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Endocrine complications based on specific tumors and their treatment",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Representative tumor, location",
"       </td>",
"       <td class=\"subtitle1\">",
"        Therapy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Highest endocrine risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hodgkin's lymphoma",
"       </td>",
"       <td>",
"        Chemotherapy, mantle irradiation",
"       </td>",
"       <td>",
"        Primary hypothyroidism, primary hypogonadism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rhabdomyosarcoma or neuroblastoma, pelvis",
"       </td>",
"       <td>",
"        Excision, chemotherapy, focal radiation",
"       </td>",
"       <td>",
"        Primary gonadal failure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        ALL",
"       </td>",
"       <td>",
"        Chemotherapy and 18 GY cranial radiation",
"       </td>",
"       <td>",
"        Growth hormone deficiency (GHD), early onset puberty, rapid tempo of puberty, osteoporosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        AML",
"       </td>",
"       <td>",
"        Chemotherapy to achieve remission, bone marrow transplant (12 GY total body radiation)",
"       </td>",
"       <td>",
"        Primary hypothyroidism, primary hypogonadism, reduced epiphyseal growth (direct effect of radiation), GHD, central hypothyroidism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medulloblastoma, posterior fossa",
"       </td>",
"       <td>",
"        Surgical excision, chemotherapy, craniospinal irradiation, and posterior fossa \"boost\" to 50 Gy",
"       </td>",
"       <td>",
"        Reduced spinal growth, central or primary or mixed hypothyroidism, GHD, precocious puberty and/or gonadotropin deficiency, ACTH deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Craniopharyngioma, suprasellar",
"       </td>",
"       <td>",
"        Biopsy, excision and &nbsp;focal radiation 30 to 50 Gy",
"       </td>",
"       <td>",
"        Panhypopituitarism, diabetes insipidus, precocious puberty or gonadotropin deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rhabdomyosarcoma, nasopharyngeal",
"       </td>",
"       <td>",
"        Excision, focal radiation 30 to 50 Gy, and chemotherapy",
"       </td>",
"       <td>",
"        Panhypopituitarism, central or primary or mixed hypothyroidism",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ALL: acute lymphoblastic leukemia; AML: acute myeloid leukemia.",
"    </div>",
