"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Cecal volvulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 283px; height: 374px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Plain abdominal radiograph of a 74-year-old man with severe abdominal pain and distension demonstrates a large air-filled cecum oriented transversely across the mid- abdomen (arrows) extending into the left upper quadrant. These features are consistent with a cecal volvulus. The subtle mural nodularity seen in the wall of the cecum suggests vascular compromise.",
